INSERT INTO `x2_campaigns` (`id`, `masterId`, `name`, `assignedTo`, `listId`, `active`, `description`, `type`, `cost`, `template`, `subject`, `content`, `createdBy`, `complete`, `visibility`, `createDate`, `launchDate`, `lastUpdated`, `lastActivity`, `updatedBy`, `sendAs`) VALUES (1,NULL,'Follow-up','Anyone','4',0,'Simple keeping-in-touch email','Email',NULL,0,'Hello again','Greetings!<br />\n<br />\nWe met recently. We&#39;re expanding our inventory and services soon. Be sure to check our website ;-)<br />\n<br />\nSincerely,<br />\n[company]<br />','admin',1,1,1380415499,0,1380415500,1380415499,'admin',NULL),(2,NULL,'New Pro Edition Available','rpatel','2',0,'A notification of new professional edition.','Email',NULL,0,'New Products and support services available!','<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		Beginning next week, we&#39;ll be adding a new line of customizable products.&nbsp;</body>\n</html>','admin',1,1,1381146621,0,1381534226,1381534226,'admin',NULL),(3,NULL,'Web Lead Intro Campaign','admin','13',0,'Introductory offer and info to all web leads','Email',NULL,0,'Interested in moving to the Cloud?','<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<img alt=\"Dreaming of the Cloud\" src=\"http://demo.x2developer.com/uploads/media/admin/Cloud.jpg\" style=\"height: 167px; width: 250px; border-width: 10px; border-style: solid; margin: 10px;\" /><br />\n		<br />\n		<span style=\"font-family:trebuchet ms,helvetica,sans-serif;\"><span style=\"font-size:14px;\"><span style=\"font-size:24px;\"><span style=\"font-family:georgia,serif;\">Dreaming of the Cloud?</span></span></span></span><br />\n		<br />\n		<span style=\"font-size:12px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Dear&nbsp;{name},<br />\n		<br />\n		Campbell&#39;s Cloud Computing is offering a 10% off discount for all Cloud Storage and Backup Services. This offer is exclusive to new customers. Imagine what&nbsp;{company} could do with the time and space you could free up.<br />\n		<br />\n		Got questions? Feel free to contact us by emailing customerserv@campbellscloud.com<br />\n		<br />\n		Thank you for your interest in Cambpell&#39;s Cloud!<br />\n		<br />\n		<br />\n		Sincerely,&nbsp;<br />\n		<br />\n		Chloe Greigo</span></span><br />\n		<br />\n		<span style=\"font-family:trebuchet ms,helvetica,sans-serif;\"><span style=\"font-size:14px;\"><span style=\"font-size:12px;\">Campbell&#39;s Cloud Computing<br />\n		831-555-5555</span></span></span><br />\n		<br />\n		<br />\n		<br />\n		<br />\n		<br />\n	</body>\n</html>','admin',1,1,1380576143,1381405821,1381405821,1381405821,'admin',NULL),(4,NULL,'Quote Follow Up','Anyone','2',0,'to send to prospects after we have emailed them a quote','Email',NULL,0,'Campbell\'s Computing Quote Follow Up','<p>\n	Hello&nbsp;{name},<br />\n	<br />\n	I want to confirm that you received the quote I had sent over for the services you inquired about from Campbell&#39;s Cloud Computing. Please let me know if you have any questions or if you would like to schedule a phone call.<br />\n	<br />\n	Thank you for considering Campbell&#39;s Cloud!</p>\n<p>\n	&nbsp;</p>\n<p>\n	Cheers!<br />\n	<br />\n	Campbell&#39;s Cloud Team</p>','admin',1,1,1381011537,0,1381011537,1381011537,'admin',NULL);
