INSERT INTO `x2_events` (`id`, `type`, `subtype`, `level`, `visibility`, `text`, `associationType`, `associationId`, `user`, `timestamp`, `lastUpdated`, `important`, `sticky`, `color`, `fontColor`, `linkColor`) VALUES (4,'feed','Announcement',NULL,1,'Who would like to do a guest blog post this week?',NULL,1,'admin',1381516388,1381531331,1,0,NULL,NULL,NULL),(7,'comment',NULL,NULL,1,'An old coworker of mine works there now. I\'ll get in touch with him on LinkedIn.','Events',6,'chames',1378839553,NULL,0,0,NULL,NULL,NULL),(8,'feed','Announcement',NULL,1,'Will somebody upload their slides from the presentation? Thank you!',NULL,3,'chames',1381516545,1381531868,1,0,NULL,NULL,NULL),(9,'feed','Confidential',NULL,0,'We need to schedule the annual performance meeting. When is a good time for you this week?',NULL,3,'admin',1381518093,1381527668,0,0,NULL,NULL,NULL),(11,'comment',NULL,NULL,1,'I can! We have had great success with our latest email marketing campaign. I think a blog about our process could be valuable to readers.','Events',4,'apelletier',1379193184,NULL,0,0,NULL,NULL,NULL),(12,'comment',NULL,NULL,1,'Thank you Amelie!','Events',4,'admin',1380040141,NULL,0,0,NULL,NULL,NULL),(13,'feed','Announcement',NULL,1,'Closing a huge sale today with Nevade Byers of Sunnyside Floors! WhooHoo!',NULL,4,'ncordova',1381466545,1381466545,0,0,NULL,NULL,NULL),(14,'comment',NULL,NULL,1,'I can also volunteer. Maybe next week. Let me know.','Events',4,'ncordova',1380040347,NULL,0,0,NULL,NULL,NULL),(15,'feed','Announcement',NULL,0,'I\'m organizing a company lunch for next Friday. Anybody have requests about where to go? I\'m thinking sushi.',NULL,6,'kxu',1381466788,1381466788,0,0,NULL,NULL,NULL),(16,'comment',NULL,NULL,1,'Sure thing Chris','Events',8,'kxu',1380040571,NULL,0,0,NULL,NULL,NULL),(17,'feed','Link',NULL,1,'<a href=\"/index.php/media/view/23\">Campbell\'s_Cloud_Computing_Heirarchy(1).odg</a>',NULL,10,'acarisella',1381466867,1381466867,0,0,NULL,NULL,NULL),(18,'feed','Announcement'